import React from 'react';
import AboutR from './AboutR';
import ContactR from './ContactR';
import {Route, Switch} from 'react-router-dom';

const RDom = () => {
    return(
        <>
        <Switch>
            <Route path = '/' component={AboutR} />
        </Switch>
        </>
    )

}
export default RDom;
